/**
 * docomo
 *
 * @author DeguchiTatsuya
 * @version 1.0
 * 
 */
class Docomo {

	var $db;
	var $db_url;
	var $uid;

	/**
	 * constructer
	 */
	function Docomo() {
		if($_REQUEST['uid']) {
			$this->uid = $_REQUEST['uid'];
		}

		// docomoの認証などはこちらの情報を使う。DatabaseActionのものではない。
		$this->db_url = 'pgsql://funkyjam:funkyjam@localhost:5432/fj_db_test';
		if($_SERVER['HTTP_HOST'] == 'm.funkyjam.com') {
			$this->db_url = 'pgsql://funkyjam:funkyjam@localhost:5432/fj_db';
		}
		$this->db = new Database($this->db_url);
		$this->db->connect();
	}

	/**
	 * check support device user agent
	 *
	 * @return boolean
	 */
	function checkSupportUA() {
		if($_SERVER['HTTP_USER_AGENT']) {
		} else {
			return false;
		}

		// 3G携帯ならOKとする。
		// 「DoCoMo/2.0」で始まるUA
		if(preg_match('/^DoCoMo\/2.0/', $_SERVER['HTTP_USER_AGENT'])) {
			return true;
		}
		
		return false;
	}

	/**
	 * check FlashLite1.1 up support device user agent
	 *
	 * @return boolean
	 */
	function checkFlashSupportUA() {
		if($_SERVER['HTTP_USER_AGENT']) {
		} else {
			return false;
		}
		
		if(preg_match('/L600i/', $_SERVER['HTTP_USER_AGENT'])
			|| preg_match('/N600i/', $_SERVER['HTTP_USER_AGENT'])
			|| preg_match('/L601i/', $_SERVER['HTTP_USER_AGENT'])
			|| preg_match('/N601i/', $_SERVER['HTTP_USER_AGENT'])
			|| preg_match('/L602i/', $_SERVER['HTTP_USER_AGENT'])
			|| preg_match('/F700i/', $_SERVER['HTTP_USER_AGENT'])
			|| preg_match('/F700iS/', $_SERVER['HTTP_USER_AGENT'])
			|| preg_match('/N700i/', $_SERVER['HTTP_USER_AGENT'])
			|| preg_match('/P700i/', $_SERVER['HTTP_USER_AGENT'])
			|| preg_match('/SA700iS/', $_SERVER['HTTP_USER_AGENT'])
			|| preg_match('/SH700i/', $_SERVER['HTTP_USER_AGENT'])
			|| preg_match('/SH700iS/', $_SERVER['HTTP_USER_AGENT'])
			|| preg_match('/D701i/', $_SERVER['HTTP_USER_AGENT'])
			|| preg_match('/D701iWM/', $_SERVER['HTTP_USER_AGENT'])
			|| preg_match('/N701i/', $_SERVER['HTTP_USER_AGENT'])
			|| preg_match('/N701iECO/', $_SERVER['HTTP_USER_AGENT'])
			|| preg_match('/P701iD/', $_SERVER['HTTP_USER_AGENT'])
			|| preg_match('/M702iG/', $_SERVER['HTTP_USER_AGENT'])
			|| preg_match('/M702iS/', $_SERVER['HTTP_USER_AGENT'])) {
		} else {
			return true;
		}
		return false;
	}

	/**
	 * authentication request
	 *
	 * @param String $ok_url
	 * @param String $ng_url
	 */
	function auth($ok_url = null, $ng_url = null) {
		$db =& $this->db;
		$db->assign('uid', $this->uid);
		$result = $db->statement(dirname(__FILE__) . '/../sql/auth.sql');

		$row = $db->fetch_assoc($result);
		if(isset($row['uid'])) {
			$location = sprintf('Location: %s', $ok_url);
			header($location);
			exit();
		};

		// 002は、解約済みの場合に出力されるエラーコード
		$ng_code = 'E002';
		$location = sprintf('Location: %s&ncd=%s', $ng_url, $ng_code);
		header($location);
		exit();
	}

	/**
	 *
	 * @param String $paramName
	 * @return mixed
	 */
	function getParam($paramName) {
		if($this->$paramName) {
			return $this->$paramName;
		}
		return false;
	}

	/**
	 *
	 * @param String $paramName
	 * @return mixed
	 */
	function setParam($paramName, $value) {
		$this->$paramName = $value;
		return true;
	}

